import React from "react";
import {Home} from "./components";
import {Route, Switch, Link} from "react-router-dom";

const App = () => {
    return (
        <div>
            <nav>
                <Link to="/">Home</Link>
            </nav>
            <Switch>
                <Route exact path="/">
                    <Home />
                </Route>
            </Switch>
        </div>
    );

};

export default App;
